import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className={s.app}>
      <header className={s.header}>Header</header>
      <div className={s.content}>
        <aside className={s.sidebar}>Sidebar</aside>
        <main className={s.mainContent}>Main Content</main>
      </div>
    </div>
  );
};

export default App;
